import React from 'react';
import ReactDOM from 'react-dom';

const TarjetaFruta = (props) =>{
  return (
    <div>
      <h3>{this.props.name}</h3>
      <hr/>
      <p>Lorem Ipsum dolor sit</p>
    </div>
  )
}


const App = () =>{
  return(
    <div>
      <TarjetaFruta name = "sandia"/>
    </div>
  )
}

ReactDOM.render(<App/>, document.getElementById('root'));
